import React from "react";

function Home() {
  return (
    <div id="home">
      <div className="titleContainer">
        <div className="title">HI</div>
        <div className="subtitle">I'm benjamin .</div>
      </div>
      <div class="wave-wrapper">
        <svg class="wave" viewBox="0 0 1440 320" preserveAspectRatio="none">
          <path
            fill="white"
            d="M0,256L48,245.3C96,235...L1440,320L1440,0L0,0Z"
          ></path>
        </svg>
        <img src="photo.jpg" class="under-img" />
      </div>
    </div>
  );
}

export default Home;
